module.exports = /*#__PURE__*/JSON.parse('[{"id":"mega-portfolio","title":"Kaila Varse","tagline":"An interactive developer portfolio with terminal, 3D, and storytelling, its this website you\'re in right now! The picture shows Kaila the developer behind this website","description":"This portfolio is itself a flagship project, designed to be more than just a static showcase. It integrates a terminal-style landing page with custom commands (help, visit, sudo inspire), immersive 3D elements powered by React Three Fiber, and a modular structure that makes adding new content as simple as editing JSON files. The portfolio brings together personal projects, teaching testimonials, startup leadership roles, and achievements into one seamless story. With support for banners, name tags, and hidden Easter eggs, the site is a living project that grows alongside my journey. Built with scalability in mind, it can be deployed on Vercel or Netlify without a backend, while still maintaining a powerful data-driven architecture.","tech":["Next.js","React","React Three Fiber","TailwindCSS","Node.js (local dev)","JSON-driven content","Vercel / Netlify Deployment"],"images":["/images/projects/kaila.jpeg","/images/projects/portfolio-2.png"],"github":"https://github.com/Polymath-Kaila/polymath-hub","demo":"YOUR_PORTFOLIO_URL_HERE"},{"id":"youtube-clone","title":"YouTube Clone","tagline":"Full-stack streaming platform with networking foundations","description":"This project was built as part of my computer networking studies, focusing on the application layer and socket programming. The goal was to solidify both programming and networking skills by recreating a YouTube-like platform with real-time features. The system integrates a Django backend for core APIs, a React.js frontend for the interface, and a simulated CDN server built with Node.js and Next.js. Real-time asynchronous communication was implemented using Node.js, while TailwindCSS and HTML handled styling and layouts. In addition, I wrote Python tests to ensure reliability and maintainability. This experience not only strengthened my backend and frontend development skills but also deepened my understanding of networking concepts such as socket programming and distributed systems.","tech":["React.js","Next.js","Django","Node.js","TailwindCSS","HTML","Python (Testing)"],"images":["/images/projects/youtube01.jpeg","/images/projects/youtube-2.png"],"github":"https://github.com/Polymath-Kaila/Youtube-clone","demo":""},{"id":"clinicx","title":"ClinicX","tagline":"Robust API-driven clinic management system","description":"ClinicX is a backend-only healthcare management system built with Django, designed to support the day-to-day operations of modern clinics. It provides a secure and scalable set of APIs that allow multiple stakeholders to interact: patients can manage appointments and access their medical history, doctors can oversee consultations, update patient records, and prescribe treatments, while suppliers handle inventory and delivery workflows. The system enforces strict role-based access control, ensuring data privacy and compliance with healthcare standards. This project strengthened my expertise in designing RESTful APIs, implementing authentication/authorization, and building reliable backend architectures for real-world use cases.","tech":["Django","Django REST Framework (DRF)","PostgreSQL","JWT Authentication","Role-Based Access Control","Automated Testing"],"images":["/images/projects/clinicx01.jpeg","/images/projects/clinicx-2.png"],"github":"https://github.com/Polymath-Kaila/clinicx","demo":""},{"id":"uniconnect","title":"UniConnect","tagline":"Andela-inspired platform for university tech communities","description":"UniConnect is a community-driven platform built to connect university students in Kenya who are passionate about technology. Inspired by Andela, it provides a space where students can showcase projects, form teams, share resources, and collaborate on real-world tech initiatives. The goal of UniConnect is to bridge the gap between classroom learning and practical experience by fostering peer mentorship and project-based learning. The system was designed to support user profiles, team formation, and discussion boards, laying the foundation for a scalable ecosystem where students can grow together and prepare for the professional tech landscape.","tech":["Django","Django REST Framework (DRF)","PostgreSQL","JWT Authentication","REST APIs","Role-Based Access Control","React.js","TailwindCSS","HTML"],"images":["/images/projects/uniconnect01.jpeg","/images/projects/uniconnect-2.png"],"github":"https://github.com/Polymath-Kaila/UniConnect","demo":""},{"id":"amka","title":"AMKA — Amua Moja Kenya Alliance web app backend","tagline":"Backend platform powering a youth movement","description":"AMKA (Amua Moja Kenya Alliance) is a backend-only platform built to support a youth-driven movement in Kenya. The system provides a set of secure and scalable APIs designed to enable community mobilization, information sharing, and collaborative decision-making. Core features include user registration and authentication, role-based access for coordinators and members, and endpoints to manage campaigns, events, and discussions. The platform emphasizes data integrity, security, and scalability to ensure it can handle a growing and diverse base of young users. This project strengthened my ability to design backend systems that align with social impact goals, combining technical rigor with civic engagement.","tech":["Django","Django REST Framework (DRF)","PostgreSQL","JWT Authentication","Role-Based Access Control","RESTful APIs","Automated Testing"],"images":["/images/projects/amka04.jpeg","/images/projects/amka-2.png"],"github":"https://github.com/Polymath-Kaila/Amka-backend","demo":""},{"id":"shadowtalk","title":"ShadowTalk","tagline":"Secure end-to-end encrypted web chat app","description":"ShadowTalk is a secure, end-to-end encrypted web-based chat application built with a multi-stack approach to ensure both performance and top-level security. The platform leverages Django for backend services and data handling, Node.js for real-time communication using WebSockets, and React with TailwindCSS for an intuitive user interface. ShadowTalk implements strong encryption mechanisms to guarantee message confidentiality, integrity, and privacy, while also following best practices in authentication, session management, and secure API design. The system was designed as a proof-of-concept for secure communications, showcasing expertise in real-time systems, encryption, and full-stack application architecture.","tech":["Django","Django REST Framework (DRF)","Node.js (WebSockets)","React.js","TailwindCSS","Python","JavaScript","HTML","End-to-End Encryption"],"images":["/images/projects/shadowtalk1.png","/images/projects/shadowtalk-2.png"],"github":"https://github.com/Polymath-Kaila/ShadowTalk","demo":""},{"id":"linkstash","title":"LinkStash","tagline":"Offline-first mobile app for saving and organizing learning links","description":"LinkStash is an offline-first Android app designed for learners to save, organize, and quickly revisit useful links shared by mentors, friends, or discovered online. Built with Expo and React Native, the app uses SQLite for local storage, ensuring users can access and search their links instantly without needing a constant internet connection. Features include tagging for organization, fast full-text search, and backup/export functionality for data safety. By focusing on an offline-first architecture, LinkStash demonstrates how mobile apps can remain lightweight, reliable, and user-friendly even without server dependencies.","tech":["Expo","React Native","SQLite","JavaScript","TypeScript","Offline-First Architecture"],"images":["/images/projects/linkstash01.png","/images/projects/linkstash-2.png"],"github":"https://github.com/Polymath-Kaila/LinkStash","demo":""},{"id":"evote-system","title":"Simplest Voting System","tagline":"Fully electronic, University-automated voting from anywhere, anytime system","description":"The Simplest Voting System is a fully electronic and automated platform designed to make elections accessible, transparent, and secure without the need for human supervisors. It allows aspirants to create profiles and share their manifestos, while voters can register, authenticate, and cast their votes from anywhere at any time. The system provides real-time score updates throughout the election period and automatically emails participants once the deadline is reached and the winner is declared. With its end-to-end digital process, this project demonstrates how technology can streamline democratic participation while ensuring fairness and efficiency.","tech":["Django","Django REST Framework (DRF)","PostgreSQL","Node.js (Realtime updates)","React.js","TailwindCSS","Email Notifications (SMTP)"],"images":["/images/projects/E-election1.png","/images/projects/evote-2.png"],"github":"https://github.com/Polymath-Kaila/E-election-system","demo":""},{"id":"emotionhub","title":"EmotionHub","tagline":"The global platform for digital surprises and emotional connections","description":"EmotionHub is a startup idea aiming to become the \'TikTok of emotions\' and \'Hallmark 2.0\'. It solves the problem of generic, expensive, or hard-to-use ways of surprising loved ones. With EmotionHub, users can upload photos, add a note, and let AI instantly craft a cinematic surprise with music, effects, and beautiful templates. Beyond digital surprises, the platform integrates real-world gifts like flowers, cakes, and photoshoots. EmotionHub is built for virality, featuring shareable links, watermarked content, referral rewards, and reminders for special occasions. The vision is to grow from a Kenya-based MVP to a global platform, blending AI, gifting, and social features into the world’s first true \'Platform of Emotions.\'","tech":["AI/ML for personalization","Django / Node.js (Backend APIs)","React.js / Next.js (Frontend)","React Native (Mobile Apps)","PostgreSQL / MongoDB","Cloud Infrastructure (AWS / GCP)","Payment Gateways","3rd-Party Gift/Delivery Integrations"],"images":["/images/projects/emotionhub001.png","/images/projects/emotionhub-2.png"],"github":"","demo":""},{"id":"oauth2-rbac-starter","title":"OAuth2 + RBAC Starter","tagline":"Minimal Node.js/Express app with Google OAuth2, roles, and JWT","description":"A minimal Node.js + Express project demonstrating how to combine Google OAuth2 authentication with role-based access control (RBAC) and JWT. Users sign up/auth via Google and are assigned one of two roles: merchant or client. Merchants can create and manage products via protected endpoints, while clients can browse available products. JWT is issued after OAuth2 login for stateless API access, and middleware enforces permissions per route. This serves as a hands-on introduction to building real-world apps that blend third-party OAuth with application roles and permissions.","tech":["Node.js","Express","Google OAuth2 (Passport.js)","JWT (jsonwebtoken)","RBAC Middleware","MongoDB (Mongoose) or PostgreSQL","Jest/Supertest "],"images":["/images/projects/outh21.jpeg","/images/projects/oauth2-rbac-2.png"],"github":"https://github.com/Polymath-Kaila/merchant-client-auth-app","demo":""},{"id":"connevio","title":"ConneVio","tagline":"A next-generation online market platform.(in development)","description":"ConneVio is a startup concept for an advanced online marketplace inspired by the scale and versatility of platforms like Uber and Jumia. The vision behind ConneVio is to combine e-commerce, logistics, and real-time services into a single ecosystem, supported by a robust and scalable technology stack that spans backend, frontend, mobile, cloud, and deployment layers. It’s designed to push the boundaries of digital marketplaces while exploring how external integrations and distributed systems can drive large-scale operations.","tech":["Django / Node.js (Backend APIs)","React.js / Next.js (Frontend)","React Native (Mobile Apps)","PostgreSQL / MongoDB","Redis / Kafka (Message Queues & Realtime)","Docker & Kubernetes (Containerization & Orchestration)","AWS / GCP Cloud Infrastructure","CI/CD Pipelines","Payment Gateways Integration","Geolocation APIs","Microservices Architecture"],"images":["/images/projects/connevio001.png","/images/projects/connevio-2.png"],"github":"","demo":""},{"id":"deriv-fx-bot","title":"Deriv FX Trading Bot","tagline":"An AI trading bot that analyse and send signals plus automate trading. (on sale)","description":"An automated foreign-exchange trading bot built to help friends experiment with systematic strategies on the Deriv platform. The bot connects to Deriv’s API for live price data and order execution, applies configurable strategies (trend-following and mean-reversion variants), and enforces strict risk management (position sizing, max daily loss, and per-trade stopouts). It includes paper-trading and live modes, backtesting on historical data, and a lightweight dashboard for monitoring open positions, PnL, and logs. Designed as an educational tool to explore algorithmic trading workflows: data ingestion, signal generation, order routing, and post-trade analytics.","tech":["Python","WebSockets / REST (Deriv API)","Pandas","NumPy","TA-Lib","SQLite/CSV (trade logs)","streamlit (dashboard)","celery (tasks)","redis (caching)","Docker "],"images":["/images/projects/derive bot1.jpeg","/images/projects/derivbot-2.png"],"github":"YOUR_GITHUB_URL_HERE","demo":"","notes":"https://github.com/Polymath-Kaila/Derive-AI-bot"},{"id":"p-huk","title":"P-HUK","tagline":"Anonymous social hookup platform (uni students) get your lover by sharing your type info anonymously","description":"P-HUK (Peers Hook-Up) is a platform created to support university students who often struggle with depression, fear, and self-expression. Unlike typical hookup platforms that require heavy verification and expose too much personal information, P-HUK allows users to start conversations anonymously and gradually build trust. Students can chat, share experiences, and connect in a safe environment where they are not pressured to reveal their identity upfront. The aim is to create a space that reduces stigma and helps students find meaningful peer support. This project demonstrates both technical skills in building secure communication systems and a commitment to addressing sensitive real-world challenges.","tech":["Django","Django REST Framework (DRF)","PostgreSQL","WebSockets / Realtime Messaging","JWT Authentication","React.js","TailwindCSS"],"images":["/images/projects/hookup003.jpeg","/images/projects/p-huk-2.png"],"github":"YOUR_GITHUB_URL_HERE","demo":""},{"id":"snake-vanilla","title":"Snake (Vanilla JS Game)","tagline":"Classic bot automated Snake  game built with HTML, CSS, and plain JavaScript(vanilla.js) click github to play","description":"A lightweight, dependency-free Snake game implemented with vanilla JavaScript. Uses a canvas-based grid, keyboard controls (arrows/WASD), food spawning with collision checks, and growing snake segments. Includes score tracking, pause/restart, and increasing speed per level. Designed for clarity and learning: modular game loop, simple state management, and clean rendering logic.","tech":["JavaScript (ES6)","HTML5 Canvas","CSS"],"images":["/images/projects/vanilla-192.png","/images/projects/snake-2.png"],"github":"https://polymath-kaila.github.io/Vanilla-Snakhttps://polymath-kaila.github.io/Vanilla-SnakeGame/eGame/","demo":""}]');

